import React from 'react'
import Dialog from '@mui/material/Dialog';
import DialogTitle from '@mui/material/DialogTitle';
import DialogActions from '@mui/material/DialogActions';
import DialogContent from '@mui/material/DialogContent';

import Button from '@mui/material/Button';

function EditPatientDialog({open, onClose, data}) {

  return (

    <Dialog
    open={open}
    classes={{ paper: "rounded-xl sc2" }}
    maxWidth='lg'
    >

        <div style={{paddingTop:"10px", paddingBottom:"10px", width:"430px", paddingLeft:"10px", paddingRight:"10px", display:"flex"}} className="py-6 md:w-[430px] w-[350px] px-5 md:px-0">

        <DialogTitle id="responsive-dialog-title">
          {"Edit Patient Details"}
        </DialogTitle>

        <DialogContent>

        </DialogContent>

        <DialogActions>
          <Button autoFocus >
            Disagree
          </Button>
          <Button autoFocus>
            Agree
          </Button>
        </DialogActions>

        </div>

    </Dialog>

  )

}

export default EditPatientDialog
